function [Se,Re] = Z2SR(Z,D,t)

    [L,e] = ZD2L(Z,D,t);

    k = 38; % number of solutions
    n = size(D,1);
    m = size(D,2);
    [~,I] = sort(e);
    L = L(:,:,I(1:k)); % filter out false roots
    I = all(~any(imag(L)));
    L = L(:,:,I); % filter out complex roots

    Se = zeros(3,m,n);
    Re = zeros(3,n,n);
    kr = 0;
    for i = 1:size(L,3)
        [S,R,flag] = DL2SR(D,L(:,:,i));
        if ~flag
            kr = kr + 1;
            Se(:,:,kr) = S;
            Re(:,:,kr) = R;
        end
    end
    Se = Se(:,:,1:kr);
    Re = Re(:,:,1:kr);

end



function [L,e] = ZD2L(Z,D,v)

    m = size(D,2);
    nZ = size(Z,2);
    e = zeros(nZ);
    L = zeros(m,m,nZ);

    for i = 1:nZ
        z = Z(2:end,i)/Z(1,i);
        t = v(:,1)*z(1)+v(:,2)*z(2)+v(:,3)*z(3)+v(:,4)*z(4)+v(:,5)/Z(1,i);

        q = 4*t(1)*t(2)*t(3) + t(4)*t(5)*t(6) - t(1)*t(6)^2 - t(2)*t(5)^2 - t(3)*t(4)^2;
        q = 0.25/sqrt(q);

        L1 = q*(4*t(2)*t(3) - t(6)^2);
        L2 = q*(4*t(1)*t(3) - t(5)^2);
        L3 = q*(4*t(1)*t(2) - t(4)^2);
        L4 = q*(4*t(1)*t(3) + 4*t(2)*t(3) + 4*t(3)*t(4) - t(5)^2 - 2*t(5)*t(6) - t(6)^2);
        L5 = q*(4*t(1)*t(2) + 4*t(2)*t(3) + 4*t(2)*t(5) - t(4)^2 - 2*t(4)*t(6) - t(6)^2);
        L6 = q*(4*t(1)*t(2) + 4*t(1)*t(3) + 4*t(1)*t(6) - t(4)^2 - 2*t(4)*t(5) - t(5)^2);

        t7 = -2*(L1*L2*L6 + L1*L3*L6 - L1*L6^2 - L2^2*L5 + L2*L3*L4 + L2*L3*L5 - 2*L2*L3*L6 + L2*L5*L6 - L3^2*L4 + L3*L4*L6);
        if abs(t7+t(7)) < abs(t7-t(7)); L1 = -L1; L2 = -L2; L3 = -L3; L4 = -L4; L5 = -L5; L6 = -L6; t7 = -t7; end

        t8 = 2*(L1^2*L6 - L1*L2*L5 - L1*L3*L4 + 2*L1*L3*L5 - L1*L3*L6 - L1*L5*L6 - L2*L3*L5 + L2*L5^2 + L3^2*L4 - L3*L4*L5);
        t9 = 2*(L1^2*L6 + 2*L1*L2*L4 - L1*L2*L5 - L1*L2*L6 - L1*L3*L4 - L1*L4*L6 + L2^2*L5 - L2*L3*L4 - L2*L4*L5 + L3*L4^2);
        t10 = 4*(L1^2*L6 + L1*L2*L4 - L1*L2*L5 - L1*L3*L4 + L1*L3*L5 - L1*L4*L6 - L1*L5*L6 - L2*L4*L5 - L2*L5*L6 - L3*L4*L5 - L3*L4*L6 + L4*L5*L6 + L2^2*L5 + L3^2*L4 - L1*L2*L6 - L1*L3*L6 + L1*L6^2 - L2*L3*L4 - L2*L3*L5 + L2*L3*L6 + L2*L5^2 + L3*L4^2);
        t11 = -L1^2*L6^2 - L2^2*L5^2 - L3^2*L4^2 + 2*L1*L2*L5*L6 + 2*L1*L3*L4*L6 + 2*L2*L3*L4*L5;

        L(1,2,i) = L1;
        L(1,3,i) = L2;
        L(1,4,i) = L3;
        L(2,3,i) = L4;
        L(2,4,i) = L5;
        L(3,4,i) = L6;
        e(i) = abs(t7 - t(7))^2 + abs(t8 - t(8))^2 + abs(t9 - t(9))^2 + abs(t10 - t(10))^2 + abs(t11 - t(11))^2;
        e(i) = e(i)/norm(t(7:11),'fro')^2;
    end

end



function [S,R,flag] = DL2SR(D,L)

    flag = 0;
    n = size(D,1);
    m = size(D,2);
    S = zeros(3,m);
    R = zeros(3,n);
    if any(L(:)<0); flag = 1; return; end
    S(:,1) = [0; 0; 0];
    S(:,2) = [sqrt(L(1,2)); 0; 0];
    x = (L(1,2)+L(1,3)-L(2,3))/(2*S(1,2));
    if L(1,3)<x^2; flag = 1; return; end
    y = sqrt(L(1,3)-x^2);
    S(:,3) = [x; y; 0];
    x = (L(1,2)+L(1,4)-L(2,4))/(2*S(1,2));
    y = (S(1,3)^2-2*S(1,3)*x+S(2,3)^2+L(1,4)-L(3,4))/(2*S(2,3));
    if L(1,4)<x^2+y^2; flag = 1; return; end
    z = sqrt(L(1,4)-x^2-y^2);
    S(:,4) = [x; y; z];

    for k = 1:n
        M = [L(1,2)+D(k,1)-D(k,2),-2*S(1,2),0,0;
            S(1,3)^2+S(2,3)^2+D(k,1)-D(k,3),-2*S(1,3),-2*S(2,3),0;
            S(1,4)^2+S(2,4)^2+S(3,4)^2+D(k,1)-D(k,4),-2*S(1,4),-2*S(2,4),-2*S(3,4)];
        [~,~,V] = svd(M);
        V = V(:,end);
        R(:,k) = V(2:4)./V(1);
    end

end